public client static void lookupEthinic(HcmEthnicOrigin _this,FormStringControl _ethinicSetStringControl)
{
    Args e;
    FormRun formRun;

    if (_ethinicSetStringControl!=null)
    {
        e = new Args();
        e.name(formStr(HMEthinicLookup));
        e.lookupField(fieldNum(HcmEthnicOrigin,EthnicOriginId));
        e.lookupValue(_ethinicSetStringControl.valueStr());
        e.caller(_ethinicSetStringControl);

        formRun = classFactory.formRunClass(e);
        formRun.init();

        _ethinicSetStringControl.performFormLookup(formRun);
    }

}
